import '../styles/welcome.css';

class Welcome_page extends React.Component {

    login_inputs() {
        return (
            <div>
                <h2>Logowanie</h2>
                <div>
                    <label>Login</label>
                    <input type="text"/>
                    <label>Haslo</label>
                    <input type="password"/>
                    <button>Zaloguj siÄ™</button>
                </div>
            </div>
        )
    }

    render() {
        return (
            <div className="welcome_back">
                <div className="welcome_header">
                    <h1>Platforma Edukacyjna</h1>
                </div>
                <div>
                    {this.login_inputs()}
                </div>
            </div>
        )
    }

}

export default Welcome_page;
